import React, { Component } from 'react';
import "../styles/name.css"

class Name extends Component {
    render() {
        return (
            <div className="name">
                <div id="boxWrapper">
                    <div class="box animated introAnimation">T</div>
                    <div class="box animated introAnimation two">H</div>
                    <div class="box animated introAnimation three">I</div>
                    <div class="box animated introAnimation four">S</div><br />
                    <div class="box animated introAnimation five">S</div>
                    <div class="box animated introAnimation six">U</div>
                    <div class="box animated introAnimation seven">C</div>
                    <div class="box animated introAnimation eight">K</div>
                    <div class="box animated introAnimation nine">S</div>
                </div>

            </div>
        );
    }
}

export default Name;
